
<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <link rel="stylesheet" href="//unpkg.com/docsify/themes/vue.css">
  <title>Laravel-admin</title>
  <script>
      window.$docsify = {
          loadSidebar: '_sidebar',
          subMaxLevel: 3,
          homepage: 'docs/',
          name: 'Laravel-admin',
          repo: 'https://github.com/muhlisabdi/laravel-admin',
          search: {
              noData: {
                  '/docs/': 'No results!',
              },
              paths: 'auto',
              placeholder: {
                  '/docs/': 'Search',
              }
          },
      }
  </script>
</head>
<body>
  <div id="app"></div>
</body>
<script src="//unpkg.com/docsify@v4.8.6"></script>
<script src="//unpkg.com/prismjs@v1.11.0/components/prism-php.min.js"></script>
<script src="//unpkg.com/prismjs@v1.11.0/components/prism-sql.min.js"></script>
<script src="//unpkg.com/docsify@v4.8.6/lib/plugins/search.js"></script>
<script src="//unpkg.com/jquery"></script>
</html>
